import React, {useState, useEffect} from 'react';
import styled from '@emotion/styled';

const Wrapper = styled.div`
z-index:100;
min-width:25vw;
min-height:50vw;
background:blue;
`

const Card = () => {
    return(
        <Wrapper/>
    )
}

export default Card;
